import React from "react";
import Header from "./Header.jsx";
import Footer from "./Footer.jsx";
import Note from "./Note.jsx";
import notes from "../notes.js";

function postNotes(){
    return <Note 
        key = {notes.key}
        title = {notes.title}
        content = {notes.content}
    />
}

function App(){
    return <div>
        <Header />
        {notes.map(postNotes)}
        <Footer />
    </div>
}

export default App;
